package main;

import java.util.ArrayList;
import java.util.List;
import java.util.Stack;

public class Main {

    private static final int MAGIC_NUMBER = 32;


    public static void main(String[] args) {
        String input = "";

        Stack<Character> stack = new Stack<>();

        // For part two
        int shortest = Integer.MAX_VALUE;
        for (int i = 65; i <= 90; i++) {
            String removedUnitTypeString = removeUnitType((char) i, input);
            int stackSize = calculateResult(removedUnitTypeString, stack);
            stack.clear();
            if (stackSize < shortest)
                shortest = stackSize;
        }

        System.out.println(shortest);
    }

    private static int calculateResult(String input, Stack<Character> stack) {
        for (int i = 0; i < input.length(); i++) {
            if (!stack.isEmpty()) {
                char inside = stack.peek();
                char insideNegative = getOtherChar(inside);
                if (input.charAt(i) == insideNegative) {
                    stack.pop();
                    continue;
                }
                stack.push(input.charAt(i));

            } else
                stack.push(input.charAt(i));
        }
        return stack.size();
    }

    private static String removeUnitType(char unit, String input) {
        char negativeUnit = getOtherChar(unit);
        char[] charArray = input.toCharArray();
        List<Integer> smallIndices = new ArrayList<>();
        List<Integer> bigIndices = new ArrayList<>();

        for (int i = 0; i < charArray.length; i++) {
            if (charArray[i] == unit || charArray[i] == negativeUnit) {
                charArray[i] = Character.MIN_VALUE;
            }
        }
        StringBuilder sb = new StringBuilder();
        for (char character : charArray) {
            if (character == Character.MIN_VALUE)
                continue;
            sb.append(character);
        }

        return sb.toString();
    }

    private static char getOtherChar(char inside) {
        if (inside > 90) return (char) (inside - MAGIC_NUMBER);
        else return (char) (inside + MAGIC_NUMBER);
    }
}
